import React from "react";
import { Layout } from "antd";
import Dasboard from "./Dasboard";
import Navbar from "./Navbar/Navbar";

const {  Header,Footer, Sider, Content } = Layout;

const Lay = () => (

    <>
        <Layout>
      <Sider>
        <Dasboard/>
      </Sider>
      <Layout>
        <Header>
          <Navbar/>
        </Header>
        <Header>

        </Header>
        <Content>Content</Content>
        <Footer>Footer</Footer>
      </Layout>
    </Layout>
    </>
);

export default Lay;
